import React from 'react'; 
import { Component } from 'react'


class MainContainer extends Component {
  constructor(props){
    super(props)
    this.state = {
      albumList: [] 
    }
   }

   componentDidMount() {
    return fetch('https://api.discogs.com/releases')
     .then(response => response.json()) 
   }




 render() {
   return ( 
    <div> 
       <p>{ this.state.name }</p>
    </div>
    )
  }
}  



export default MainContainer;
